import React, { useEffect, useState } from "react";
import { ProjectDto } from "./projects.model";
import * as projectEndpoints from "../../apiEndpoints/ProjectEndpoints";

const [projects, setProjects] = useState<ProjectDto[]>([]);

    useEffect(() => {
        // Fetch projects from the API using the imported function
        fetchProjects();
    }, []);

    const fetchProjects = () => {
        projectEndpoints.getAll()
            .then(data => setProjects(data))
            .catch(error => console.error('Error fetching projects:', error));
    };

export default function IndexProjects() {
  return (
    <table className="table-fixed w-full">
      <thead className="bg-gray-200">
        <tr>
          <th className="border px-4 py-2 w-12">#Id</th>
          <th className="border px-4 py-2">Name</th>
          <th className="border px-4 py-2">Description</th>
          <th className="border px-4 py-2">Deadline</th> {/* Adjusted for the Project interface */}
        </tr>
      </thead>
      <tbody>
        {projects.map((project) => (
          <tr key={project.projectId}>
            <td className="border px-4 py-2 w-12">{project.projectId}</td>
            <td className="border px-4 py-2">{project.name}</td>
            <td className="border px-4 py-2">{project.description}</td>
            <td className="border px-4 py-2">{project.deadline}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
